import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainLayout from './components/Layout/MainLayout';
import SalesList from './components/Sales/SalesList';
import SaleForm from './components/Sales/SaleForm';
import HumansList from './components/Humans/HumansList';
import HumanForm from './components/Humans/HumanForm';
import QueryForm from './components/Queries/QueryForm';

const App = () => (
    <Router>
        <MainLayout>
            <Routes>
                <Route path="/sales" element={<SalesList />} />
                <Route path="/sales/new" element={<SaleForm />} />
                <Route path="/humans" element={<HumansList />} />
                <Route path="/humans/new" element={<HumanForm />} />
                <Route path="/humans/edit/:id" element={<HumanForm />} />
                <Route path="/queries" element={<QueryForm />} />
            </Routes>
        </MainLayout>
    </Router>
);

export default App;
